@app.route('/verification', methods=['GET', 'POST', 'OPTIONS'])
def verification():   
    if request.method == 'POST':
        #try:
        if 'img' not in request.json:
            return jsonify({"error": "no file"})
        input = request.get_json(force=True)
        if not input:
            return jsonify({"message": "Must provide message to send to slack"}, 400)
           
        # Opening JSON file
        #f = open('test.json')
        
        # returns JSON object as 
        # a dictionary
        #db = json.load(f)
        #db = json.loads(json.loads(f))

        # with open('test.json') as f:
        #     db = json.loads(f.read())
        try:
            nik_db = db['NIK']
            name_db = db['Nama']
            vector_db = db['Vector']
            
            #try:
            name_input = input['nama'] 
            img_input = input['img'].replace('data:image/webp;base64,','')
            #img_input = input['img']
            
            im0s = array(Image.open(io.BytesIO(base64.b64decode(img_input))))
            im0s = cv2.cvtColor(im0s, cv2.COLOR_BGR2RGB)
            vector_input, xyxy = create_signature(source=img_input)
           
            if vector_input == 'gagal':
                return jsonify({'status' : 'failed', 'message': 'wajah tidak terdeteksi'})
            c1, c2 = (int(xyxy[0][0]), int(xyxy[0][1])), (int(xyxy[0][2]), int(xyxy[0][3]))
            cv2.rectangle(im0s, c1, c2, (255,0,0), lineType=cv2.LINE_AA)                 
            min_dist=10
            identity=' '
            #for key, value in database.items() :
            dist = linalg.norm(vector_input-vector_db)
            
            if dist < min_dist:
                min_dist = dist
                identity = name_db  
            else:
                identity = 'unknown' 
            
            #plot_one_box(xyxy, im0s, label=identity , line_thickness=3, kpt_label=5, steps=3, orig_shape=im0s.shape[:2])

            #cv2.putText(im0s ,identity, (100,100),cv2.FONT_HERSHEY_SIMPLEX, 1, (255,0 , 0), 2, cv2.LINE_AA)

            _, im_arr = cv2.imencode('.jpg', im0s)  # im_arr: image in Numpy one-dim array format.
            im_bytes = im_arr.tobytes()
            im_output_b64 = base64.b64encode(im_bytes)
            im_output_b64_str = im_output_b64.decode("utf-8") 

            name = input['nama']

            if name == identity:
                return jsonify({'status' : 'ok', 'NIK':nik_db, 'Name' : identity, 'ImageBytes': im_output_b64_str})
            
            else:
                    return jsonify({'status' : 'failed', 'message':'Wajah tidak ada pada database'})
        except Exception as e:
            return jsonify({"error": str(e)})
    return 'OK'
    




